import React from "react";
import './Contact.css';
const Contact = () => {
    return (
    <>
    <div className="container">
    <div className="column">
    <h1 className="contact-title">My Contacts</h1>
    </div>
    <div className="column">
    <a className ="btn" href="https://www.linkedin.com/in/jason-cheung-33337a206/"><i class="fa-brands fa-linkedin-in"></i></a>
    <h2 className="linkedIn-name">Jason Cheung</h2>
    </div>
    <div className="column">
    <i class="fa fa-envelope" aria-hidden="true"></i>
    <h2 className="email-title">jcheung379@gmail.com</h2>
    </div>
    <div className="column">
    <i class="fa-solid fa-phone"></i>
    <h2 className="phone-title">0416677252</h2>
    </div>
    <div className="contact-form">
        <form id="contact-form" onSubmit={this.handleSubmit.bind(this)} method = "POST">
            <div className="form-group">
                <label htmlFor="name">Name</label>
                <input type="text" className="form-control" value={this.start.name} onChange={this.onNameChange.bind(this)}/>
            </div>
        </form>
    </div>
    </div>
    </>);
  };
function onNameChange(event) {
    this.setState({name: event.target.value})
}
function onEmailChange(event) {
    this.setState({email: event.target.value})
}
function onMessageChange(event) {
    this.setState({message: event.target.value})
}
function handleSubmit(event) {
}

export default Contact;
